import s from './Orders.module.css';

const Orders = ({ name, price, process }) => {

  return (
    <>
      <div className={s.container}>
        <table>
          <tr>
            <td>{name}</td>
            <td>${price}</td>
            <td>{process}</td>
          </tr>
        </table>
      </div>
    </>
  );
}

export default Orders;
